import React from "react";
import "./CleanTextBox.css";

function CleanTextBox() {
  const boxStyle = {
    width: '100%',
    height: '400px',
    border: '1px solid black',
  };
  return (
    <div style={boxStyle}></div>
  );
}

export default CleanTextBox;
